def UsernameChange(usernames):
    response = []
    for username in usernames:
        i=0
        greater = False
        size_name = len(username)-1
        while greater == False and i < size_name:
            if username[0] > username[i]:
                greater = True
                response.append("YES")
                
            if i==size_name-1 and greater == False:
                response.append("NO")
            i += 1
    return response
                

